export default function HomePage() {
  return (
    <>
      <Nav />
      <Splash primaryText="Hi, I'm Josh Ashton!" secondaryText="Junior full stack developer."/>
    </>
  );
}

function Nav() {
  return (
    <>
      <nav>
        <a href="index.html">Josh Ashton</a>
        <div>
          <ul>
            <a href="projects">
              <li>Projects</li>
            </a>
          </ul>
        </div>
      </nav>
    </>
  );
}

function Splash( { primaryText, secondaryText }) {
  return (
    <>
      <div>
        <h1>{primaryText}</h1>
        <h2>{secondaryText}</h2>
      </div>
    </>
  );
}
